	;; Figure out branching
	.requ	ir, r2		; instruction register in r2
	.requ	dr, r3		; destination register (offset) in r3
	.requ	sr, r4		; source register in r4
	.requ	br, r4
	.requ	opc, r9		; opcode in r9
	.requ	wcc, r11	; condition code bits in r11
	
	lea	warm, r0
	trap	$SysOverlay
	and	$0xFFFFFF,wpc
	mov	wpc, r1
	mov	warm(r1), ir
	mov	ir, r7
	shr	$29, r7
	mov	cctable(r7), rip

wmovs:	mov	ccr, wcc
	add 	$1, wpc
	mov	ir, wregs(dr)
	and	$0xFFFFFF,wpc
	mov	wpc, r1
	mov	warm(r1), ir
	mov	ir, r7
	shr	$29, r7
	mov	cctable(r7), rip
	
wmov:	add 	$1, wpc
	mov	ir, wregs(dr)

	
loop:				; ==== INSTRUCTION FETCH START ====
	and 	$0xFFFFFF,wpc	
	mov 	wpc, r1
	mov	warm(r1), ir

	mov 	ir, r7
	shr	$29, r7
	mov	cctable(r7), rip
	
	


cont:	
	mov	ir, opc
	sar	$23, opc
	and	$0x3F, opc	; opcode stored in opc
	mov	opinit(opc), rip



stop:	add	$1, wpc
	and	$0xFFFFFF,wpc
	mov	wpc, r1
	mov	warm(r1), ir
	mov	ir, r7
	shr	$29, r7
	mov	cctable(r7), rip

