cgt:	mov	gttable(wcc), rip


both:	mov	ir, r10		
	shr	$15, r10
	and	$0xFF, r10 	; 8-bit mask of registers in r10
	mov	rjmp(r10), rip	; jump to code for getting registers

nodest:	mov	ir, sr
	shr 	$15, sr
	and	$0xF, sr
	mov	wregs(sr), sr
	
	and	$0x7FFF, ir
	mov	rhsjmp(ir), rip
	

